//importar stylesheet da biblioteca RN
import { StyleSheet } from 'react-native';

export default StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: 'yellow',
		alignItems: 'center',
		justifyContent: 'center',
	},
	logoContainer: {
		flex: 1,
		backgroundColor: 'green',
		width: '100%',
	},
	inputContainer: {
		flex: 2,
		backgroundColor: 'orange',
		width: '100%',
	},
	signupContainer: {
		flex: 1,
		backgroundColor: 'red',
		width: '100%',
	},
});
